  ["reposedly"] = "<html><body><h1>reposedly</h1><p>reposedly<p></p>adv.<p></p>repose1的变形<p></p>repose1<p></p>[ri'pəuz]<p></p>vi.<p></p>躺着休息：<p></p>After lunch he reposed on the couch.<p></p>午饭后他躺在长沙发上休息。<p></p>休养：<p></p>In fine weather you can find many green turtles reposing on the sand.<p></p>天气好时你可以看到许多海龟在沙滩上养神。<p></p>长眠，安息：<p></p>The body of her grandmother reposes in the churchyard.<p></p>她祖母的遗体长眠于教堂的墓地中。<p></p>静卧；蕴藏：<p></p>The land reposes in the dusk.<p></p>大地静卧在暮色之中。<p></p>安放在；坐落在：<p></p>This seam of coal reposes on a layer of clay.<p></p>这个煤层处于一层黏土岩之上。<p></p>[古语]相信(常与 in 连用)；信赖；取决于…；建立于…之上(常与on或upon连用)：<p></p>The truth of his argument reposes on his honesty.<p></p>他的论点的真实性是建立在他本人的诚实之上的。<p></p>(记忆等)萦绕；停留(常与on连用)：<p></p>Her mind reposed on the happy old days.<p></p>她回忆起愉快的往日。<p></p>vt.<p></p>[repose oneself]使休息;使依靠：<p></p>[repose oneself]使休息;使依靠：<p></p>She reposed her head on her husband's shoulder.<p></p>她把头靠在丈夫的肩上。<p></p>n.<p></p>躺卧<p></p>休息；睡眠<p></p>长眠；长眠处<p></p>(心绪)宁静；安详，泰然自若；(举止)镇静<p></p>平静；静止；宁静<p></p>(绘画等结构、色彩的)和谐；恬静<p></p>变形：<p></p>vi.<p></p>reposed<p></p>. reposing</p></body></html>",
