  ["resolving"] = "<html><body><h1>resolving</h1><p>n analysis into clear-cut components<p></p>v bring to an end; settle conclusively<p></p>v reach a conclusion after a discussion or deliberation<p></p>v reach a decision<p></p>v understand the meaning of<p></p>v make clearly visible<p></p>v find the solution<p></p>v cause to go into a solution</p><p>n. 解析；分解</p></body></html>",
